            });

            function fetchTags() {
                $.get("/papi/tags.php", function(data) {
                    if (data.code === 200 && data.message == 'success') {
                        if (Array.isArray(data.body.tags) && Array.isArray(data.body.tokens)) {
                            data.body.tags.forEach(row => {
